import React from 'react';
import ReactDOM from 'react-dom';
import { Route, BrowserRouter as Router, Switch, Redirect} from 'react-router-dom';

import './index.css';

import App from './Home/App';
import NotFound from './NotFound/notFound';
import Login from './Login/login'
import PagAdm from './PagAdm/pagAdm'
import PagProntuarios from './PagProntuario/pagProntuario'

import reportWebVitals from './reportWebVitals';

const routing = (
  <Router>
    <div>
      <Switch>
        <Route exact path="/" component={App} />
        <Route path="/prontuarios" component={Prontuarios} />
        <Route path="/notfound" component={NotFound} />
        <Route path="/login" component={Login} />
        <Route path="/Adm" component={PagAdm} />
        <Route path="/Prontuario" component={PagProntuarios} />
        <Redirect to = "/notfound" />
      </Switch>
    </div>
  </Router>
)

ReactDOM.render(routing, document.getElementById('root'));

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
